import React, { Component } from 'react';

class Blog2 extends Component {
  render() {
    return (
    
    <main>
    <h1><center>Holi</center></h1>
    <center><img className="blog" src={process.env.PUBLIC_URL + '/Holi1.jpeg' } alt="Holi"  /></center>

    <p> </p>
    
    </main>
    );
  }
}

export default Blog2;
